import React, { useEffect, useState } from "react";
import {
  MapContainer,
  TileLayer,
  ZoomControl,
  LayersControl,
  LayerGroup,
  Marker,
  Popup,
} from "react-leaflet";
import { PageContainer, MapTileLayer } from "./styles/product_style.js";
import TemperatureLegend from "../components/legend_temp.js";
import get_AIS from "./aisstream.js";

function Product() {
  // const API_KEY = "06aac0fd4ba239a20d824ef89602f311"; /* api key that works */
  const API_KEY = "e6d8c9c20269bd6d193a610ab4f7d761"; /* my api key */
  const center = [39.1, -76.1];

  console.log(get_AIS);

  return (
    <PageContainer>
      <MapContainer
        center={center}
        zoom={7}
        scrollWheelZoom={true}
        zoomControl={false}
        crossOrigin={true}
      >
        <MapTileLayer
          // url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          url="https://api.maptiler.com/maps/basic-v2/{z}/{x}/{y}.png?key=lVv1GqW1mIEStV3bJv0u"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
        />
        <LayersControl position="topleft">
          <LayersControl.Overlay name="Precipitation">
            <TileLayer
              url={`https://tile.openweathermap.org/map/precipitation_new/{z}/{x}/{y}.png?appid=${API_KEY}`}
            />
          </LayersControl.Overlay>
          <LayersControl.Overlay name="Clouds">
            <TileLayer
              url={`https://tile.openweathermap.org/map/clouds_new/{z}/{x}/{y}.png?appid=${API_KEY}`}
            />
          </LayersControl.Overlay>
          <LayersControl.Overlay name="Temperature">
            <LayerGroup>
              <TileLayer
                url={`https://tile.openweathermap.org/map/temp_new/{z}/{x}/{y}.png?appid=${API_KEY}`}
              />
            </LayerGroup>
          </LayersControl.Overlay>
          <LayersControl.Overlay name="Wind">
            <TileLayer
              url={`https://tile.openweathermap.org/map/wind_new/{z}/{x}/{y}.png?appid=${API_KEY}`}
            />
          </LayersControl.Overlay>
          <LayersControl.Overlay name="Pressure">
            <TileLayer
              url={`https://tile.openweathermap.org/map/pressure_new/{z}/{x}/{y}.png?appid=${API_KEY}`}
            />
          </LayersControl.Overlay>
          <LayersControl.Overlay name="Test">
            <TileLayer
              url={`https://api.maptiler.com/tiles/ocean-rgb/{z}/{x}/{y}.webp?key=lVv1GqW1mIEStV3bJv0u`}
            />
          </LayersControl.Overlay>
          <LayersControl.Overlay name="AIS">
            <LayerGroup>
              {aisData.map((data, index) => (
                <Marker key={index} position={[data.latitude, data.longitude]}>
                  <Popup>
                    <strong>Ship ID:</strong> {data.shipId}
                    <br />
                    <strong>Latitude:</strong> {data.latitude}
                    <br />
                    <strong>Longitude:</strong> {data.longitude}
                  </Popup>
                </Marker>
              ))}
            </LayerGroup>
          </LayersControl.Overlay>
        </LayersControl>
        <ZoomControl position="topright" />
        {/* <TemperatureLegend /> */}
        {/* <Square center={center} size={100000}>
          <Popup>Hello Popup</Popup>
        </Square> */}
      </MapContainer>
    </PageContainer>
  );
}

export default Product;
